import React, { Component } from "react";
import Navbar from "react-bootstrap/Navbar";
import { Link } from "react-scroll";
import './style.css';

const icon = (
  <span class="logo">
    <a href="/">
      <img src="../../img/logo/vkbe-finallogo-02.png" height="33" width="120" alt="text here" /></a>
  </span>
);

class NavigationBar extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <Navbar fixed="top" bg="dark" variant="dark">
        <Navbar.Brand>
          <img
            alt="logo"
            src="../../img/logo/vkbe-finallogo-02.png"
            width="30"
            height="30"
            className="d-inline-block align-top"
          />{' '}
          VKBE
        </Navbar.Brand>
        <Link
          activeClass="active"
          to="main"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
          >Main
        </ Link>
        <Link
          activeClass="active"
          to="about"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
          >About
        </ Link>
        <Link
          activeClass="active"
          to="contact"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
          >Contact
        </ Link>
      </Navbar>
    )
  }
}

export default NavigationBar;
